content:
세상의 어느 부모가 자식들 이름으로 안불러주고 그 집단 이름으로 불러주냐..;;;;
그럴거면 이름을 지어주지 말든가;;
진짜 애들을 전투병기로 만들곤 훈련만 시키고 방치하는 거잖아....

깽판 치는게 목적이면 
한방이 저모양인 여래신장 달고 온놈을 
어떻게 막냐;;

?? : 남이 만들어준 진짜는 진짜가 아니다. 
진짜는 내가 &#x27;만든다&#x27; 
????

넘 재밌게 보고있어요.
늘 댓글 안달고 보기만해서 죄송해요
작가님 사랑합니다 &hearts;&hearts;&hearts;&hearts;&hearts;

그레이트가 저 이야길 들으면
&quot;아, 그럼 제가 베어의 스페어 몸뚱이로군요. 알겠습니다. 가져가세요.&quot;

할 리가 없잖아...
